  const scheduleNameRef = useRef()

  function handleAddSchedule(e) {
    const name = scheduleNameRef.current.value
    if (name === '') return
  }

  return (
    <div>
      <ScheduleList schedules={schedules} />
      <input ref={scheduleNameRef} type="text" />
      <button onClick={handleAddSchedule}>Add schedule</button>
    </div>
  )
}
